import React from 'react';

const JournalEntry = () => {
  return (
    <div className='journal__entry'>
      <div 
        className='journal__entry-picture'
        style={{
          backgroundSize:'cover', 
          backgroundImage:'url(https://i.pinimg.com/originals/f1/3f/b3/f13fb34cc03956b16ad356f8122b9621.jpg)'
        }}
      >

      </div>
    </div>
  )}

export default JournalEntry;
